export default function Section1(props) {
  return (
    <div className="container">
    <h1>{props.heading}</h1>
    <p className="lead">
      {props.text}
    </p>
    <a href="#" className="btn btn-primary">
      ითანამშრომლეთ ჩვენთან
    </a>
  </div>
  );
}
